// Details.js
import React, { useState, useEffect } from "react";
import axios from "axios";

function Details({ cityName }) {
  // Zugriff auf die API-Schlüssel aus den Umgebungsvariablen
  const { REACT_APP_API_KEY } = process.env;
  console.log(cityName);
  const apiURL = `https://api.openweathermap.org/data/2.5/forecast?q=${cityName}&appid=${REACT_APP_API_KEY}&units=metric&lang=de`;

  axios
    .get(apiURL)
    .then((res) => {
      console.log(
        res.data.list[0].dt_txt,
        res.data.list[1].dt_txt,
        res.data.list[2].dt_txt,
        res.data.list[3].dt_txt,
        res.data.list[4].dt_txt,
        res.data.list[5].dt_txt,
        res.data.list[6].dt_txt,
        res.data.list[7].dt_txt,
        res.data.list[8].dt_txt,
        res.data.list[9].dt_txt,
        res.data.list[10].dt_txt,
        res.data.list[11].dt_txt
      );
    })
    .catch((err) => {
      console.error("Error fetching city data:", err);
    });

  return <div>Test</div>;
}

export default Details;
